import React from "react";
import "./../styles/Header.css";

function Header() {
  return (
    <header
      className="header"
      onClick={() => (window.location.href = "/")} // 루트로 이동
    >
      <img src="../assets/header-image2.png" alt="The Ajou Globe" className="header-image2" />
    </header>
  );
}

export default Header;
